	//随机取一个新浪微博账户 
	static function get_user_tsina($key = ''){
		$login_user = array(); 
		require_once dirname(__FILE__).'/../../account/tsina.php';
		require_once COMM_PATH . '/lib/spider/platform.class.php'; 
		$a['name']='spider';
		$a['state']=1;  
		$a['pt'] = duap_platform::name_platform('tsina');
		$t1 = duap_account_tsina::get_account_list_from_cache($a);  
		if(!$t1) return false;
		$login_user=array();
		foreach($t1 as $k=>$i) {$login_user[] = array('user'=>$i['user_name'],'pwd'=>$i['pwd'],'uid'=>$i['uid'],'id'=>$i['id']); }
		//print_R($login_user);exit;      
		$hash = self::_time33Hash($key);
		$count=count($login_user); 
		$rt = abs(fmod($hash, $count)); 
		return $login_user[$rt]; 
	}

	static function get_login_url($site_name,$username,$pwd,$other=array()){
		$login_url = array();
		$login_url['tsina']['login_ref'] = 'http://login.sina.com.cn/signup/signin.php?';
		$login_url['tsina']['url'] = 'http://login.sina.com.cn/sso/login.php';
		$login_url['tsina']['request'] ='client=ssologin.js%28v1.3.11%29'.
										'&callback=parent.sinaSSOController.loginCallBack'.
										'&client=ssologin.js%28v1.3.11%29'.
										'&encoding=GB2312&entry=sso'.
										'&from='.
										'&gateway=1'.
										'&returntype=IFRAME'.
										'&savestate=0'.
										'&service=sso'.
										'&setdomain=1'.
										'&username='.$username.
										'&password='.$pwd.
										'&useticket=0';
		$login_url['weibo']['login_ref'] = 'http://weibo.com/';
		$login_url['weibo']['url'] = 'http://login.sina.com.cn/sso/login.php?client=ssologin.js(v1.3.16)'; 
		$login_url['weibo']['request'] ='client=ssologin.js(v1.3.16)'.
										'&encoding=UTF-8'.
										'&entry=weibo'.
										'&from='.
										'&gateway=1'.
										'&nonce='.$other['nonce'].
										'&pwencode=wsse'.
										'&returntype=META'.
										'&savestate=0'.
										'&servertime='.$other['servertime'].
										'&service=miniblog'.
										'&sp='.$pwd.
										'&ssosimplelogin=1'.
										'&su='.$other['su'].
										'&url=http://weibo.com/ajaxlogin.php?framelogin=1&callback=parent.sinaSSOController.feedBackUrlCallBack'.
										'&username='.$username.
										'&useticket=1';
		return $login_url[$site_name];
	}

