	//键值对 取 代理服务器
	static function get_spider_proxy($key){ 
		$proxy = array();
		//$proxy[] = array('p'=>'http://116.232.225.122:808','u'=>'newcogs:ncg');
		
		if(!$proxy) return false;
		$hash = self::_time33Hash($key);
		$count=count($proxy);
		$rt = abs(fmod($hash, $count));
		return $proxy[$rt];  
	}

	static function _time33Hash($str) {
        $hash = 0;
        $n = strlen($str);
        for ($i = 0; $i <$n; $i++) {
            $hash += ($hash <<5 ) + ord($str[$i]);
        }
        return $hash;
    }

